#ifndef GRAPH_H_
#define GRAPH_H_
class Node { public: Node() { } size_t get_pos() const;// 返回节点编号 size_t node_pos_ = 0;// 节点编号 vector<size_t> adjacent_nodes_;// 相邻节点编号 vector<uint64_t> adjacent_weights_;// 相邻节点权重 uint64_t shortest_path_ = std::numeric_limits<uint64_t>::max();// 最短路径 bool visited = false;// 是否被访问 Node *parent_node = nullptr;// 父节点
};
class Graph { public: Graph(size_t num_verticies); Node &get_node(size_t node_pos);// 返回对应节点 ~Graph() {} size_t num_verticies_;// 网络下节点数量 vector<Node> V_;// 网络下节点集
};
std::tuple<uint64_t, bool> Dijkstra_SP( Graph &G, size_t src_node_pos, size_t dst_node_pos);// 寻找最短路径
list<Node> Recover_Path( Graph &G, size_t src_node_pos, size_t dst_node_pos);// 打印路径
#endif #include <random>
