#include <iostream>
#include <set>
#include "Graph.h" struct rule { bool operator()(const Node &n1, const Node &n2) { return n1.shortest_path_ < n2.shortest_path_; }
}; Graph::Graph(size_t num_verticies) { num_verticies_ = num_verticies; V_ = vector<Node>(num_verticies); for (size_t i = 0; i < num_verticies; i++) { V_[i].node_pos_ = i; }
} Node &Graph::get_node(size_t node_pos) { return V_[node_pos];
} size_t Node::get_pos() const { return node_pos_;
} std::tuple<uint64_t, bool> Dijkstra_SP( Graph &G, size_t src_node_pos, size_t dst_node_pos) { // 初始化路径矩阵 for (vector<Node>::iterator it = G.V_.begin(); it != G.V_.end(); ++it) { it->shortest_path_ = numeric_limits<uint64_t>::max(); it->visited = false; } // 初始点 Node &start_node = G.get_node(src_node_pos); start_node.shortest_path_ = 0; start_node.visited = true; std::multiset<Node, rule> frontier; frontier.insert(start_node); // 没有找到结束节点时 while (!G.get_node(dst_node_pos).visited) { if (frontier.empty()) { return std::make_tuple(0, false); } // 获取边界中最近的节点 multiset<Node, rule>::iterator nearest_node_it = frontier.begin(); Node &nearest_node = G.get_node(nearest_node_it->node_pos_); frontier.erase(nearest_node_it); nearest_node.visited = true; // 如果我们找到路径它是最短的路径 if (nearest_node.get_pos() == dst_node_pos) { return std::make_tuple(nearest_node.shortest_path_, true); } // 处理所有相邻节点 for (size_t i = 0; i < nearest_node.adjacent_nodes_.size(); i++) { Node &node = G.get_node(nearest_node.adjacent_nodes_[i]); // 如果已经访问过节点，则跳过它 if (node.visited == false) { // 计算到节点的新的最短距离 uint64_t current_sp = nearest_node.shortest_path_ + nearest_node.adjacent_weights_[i]; // 如果新计算出的路径较短，则之前计算出的路径 if(current_sp < node.shortest_path_) { // 查找此节点是否在边境 multiset<Node, rule>::iterator ret = frontier.find(node); // 如果是，我们找到较短的路径，则在多集中更新此节点的路径和位置 if (ret != frontier.end()) { frontier.erase(ret); } // 我们发现到该节点的路径较短 node.shortest_path_ = current_sp; node.parent_node = &nearest_node; // 更新多集节点 frontier.insert(node); } } } } return std::make_tuple(0, false);
} list<Node> Recover_Path(Graph &G, size_t src_node_pos, size_t dst_node_pos) { list<Node> path; Node &src_node = G.get_node(src_node_pos); Node &cur_node = G.get_node(dst_node_pos); // 从目标节点开始恢复路径 while(cur_node.get_pos() != src_node.get_pos()) { path.push_front(cur_node); cur_node = *cur_node.parent_node; } path.push_front(src_node); return path;
}

