void bubbleSort(int array[], int size)
{
for (int step = 0; step < size - 1; ++step) { int swapped = 0; for (int i = 0; i < size - step - 1; ++i) { if (array[i] > array[i + 1]) { int temp = array[i]; array[i] = array[i + 1]; array[i + 1] = temp; swapped++; } } if (swapped == 0) break; }
} int main()
{ int data[] = {-2, 45, 0, 11, -9}; int size = sizeof(data) / sizeof(data[0]); bubbleSort(data, size);
